//--- あとでボタンにする ---//
let numBoxes = 25;
let numDefalutLights = 7;

//--- Boxの作成 ---//
//枠の作成
const parent = document.getElementById('main');
const createWaku = document.createElement('div');
createWaku.classList.add('boxWaku');

//デフォルトライトの設定
let arrBoxes = [] ;
for (let i=0; i<25; i++){
  arrBoxes.push(i);
};

let arrDefaltLights = [];
for (let i=0; i<numDefalutLights; i++){
  let defaltLights =arrBoxes[Math.floor( Math.random() * arrBoxes.length ) ] ;
  arrDefaltLights.push(defaltLights);

  let indexOf = arrBoxes.indexOf( defaltLights);

  arrBoxes.splice(indexOf, 1);
};
console.log('arrBoxes:'+arrBoxes);
console.log('arrDefaltLights:'+arrDefaltLights);

//Boxの出力
const reference = document.getElementById('messageFinish');
parent.insertBefore(createWaku, reference)
for(let i=1; i <= numBoxes; i++){
  const createBox = document.createElement('div');
  createBox.classList.add('box');

  if(arrDefaltLights.includes(i))createBox.classList.add('lightning');

  createWaku.appendChild(createBox);
};


//--- ライトニング処理 ---//
const box = document.querySelectorAll('.box');

for(let now=0; now < box.length; now++){

  box[now].onclick = function () {
    //番地の定義
    console.log('配置：' + now + '番目');
    let up = now - 5;
    let left = now - 1;
    let right = now + 1;
    let down = now + 5;

    //スキップ条件の定義
    let skip_up = false;
    let skip_left = false;
    let skip_right = false;
    let skip_down = false;
    if( now <= 4 ) skip_up = true;
    if( (now % 5) === 0 ) skip_left = true;
    if( ((now+1) % 5) === 0 ) skip_right = true;
    if( now >= 20 ) skip_down = true;

    //ライトニング
    //box[now].classList.toggle('lightning');
    if (!skip_up) box[up].classList.toggle('lightning');
    if (!skip_left) box[left].classList.toggle('lightning');
    if (!skip_right) box[right].classList.toggle('lightning');
    if (!skip_down) box[down].classList.toggle('lightning');


    //音声を鳴らす
    let base64 = "";
    let sound = new Audio("data:audio/wav;base64," + base64);
    sound.play();

    //ライト数カウント
    let numLights = [];
    for(let i=0; i < box.length; i++){
      let result = box[i].classList.contains('lightning');
      if(result)numLights.push('light'+i);
      };
    console.log(numLights);
    console.log(numLights.length);

    //フィニッシュメッセージ
    const message = document.getElementById('messageFinish');
    if (numLights.length === 0){
      console.log('OK');
      message.classList.remove('hidden')
    };

  };

};
